import React, { Component } from 'react';
import Heading from '../../atoms/main/Heading';
import DeliveryTime from '../../atoms/main/DeliveryTime';
import ItemsCount from '../../atoms/main/ItemsCount';
import ClearCart from '../../atoms/main/ClearCart';
import './billHeading.scss';

class BillHeading extends Component {
    render() {
        return (
            <>
                <Heading />
                <div className='subHeading'>
                    <div className='delivery'>
                        <DeliveryTime />
                        <ItemsCount />
                    </div>
                    <ClearCart />
                </div>
            </>
        )
    }
}

export default BillHeading
